import React, { useState, useEffect } from 'react';
import { 
  Upload, 
  Search, 
  User, 
  Settings, 
  FileText, 
  BarChart3, 
  ShoppingCart, 
  Lock, 
  Eye, 
  Download, 
  RotateCw, 
  ZoomIn, 
  ZoomOut, 
  Layers, 
  Edit3, 
  Save, 
  Share2, 
  Bell, 
  Shield, 
  CheckCircle, 
  Clock, 
  AlertTriangle,
  LogOut,
  Menu,
  X,
  Trash2,
  Filter,
  Package
} from 'lucide-react';

// Mock Data
const mockUsers = {
  patient: { id: '1', email: 'patient@example.com', role: 'Patient', organization: 'Self', name: 'John Doe' },
  business: { id: '2', email: 'business@hospital.com', role: 'Business User', organization: 'City Hospital', name: 'Dr. Sarah Smith' },
  pci: { id: '3', email: 'analyst@pcibio.com', role: 'PCI User', organization: 'PCI', name: 'Alex Johnson' },
  admin: { id: '4', email: 'admin@pcibio.com', role: 'PCI Admin', organization: 'PCI', name: 'Admin User' }
};

const mockSlides = [
  { id: 'slide001', filename: 'breast_biopsy_001.svs', upload_date: '2025-08-15', status: 'processed', patient_hash: 'pat_hash_001', analysis_status: 'completed' },
  { id: 'slide002', filename: 'lung_tissue_002.scn', upload_date: '2025-08-14', status: 'processing', patient_hash: 'pat_hash_002', analysis_status: 'queued' },
  { id: 'slide003', filename: 'liver_sample_003.tiff', upload_date: '2025-08-13', status: 'uploaded', patient_hash: 'pat_hash_003', analysis_status: 'pending' }
];

const mockServices = [
  { id: 'svc001', name: 'Basic Analysis', price: 150, description: 'Standard tissue analysis with basic measurements' },
  { id: 'svc002', name: 'Advanced AI Analysis', price: 300, description: 'Comprehensive AI-powered analysis with detailed reporting' },
  { id: 'svc003', name: 'Priority Processing', price: 100, description: 'Fast-track processing (24-hour turnaround)' }
];

const HIPAASlideplatform = () => {
  const [currentUser, setCurrentUser] = useState<any>(null);
  const [currentPage, setCurrentPage] = useState('login');
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [uploadProgress, setUploadProgress] = useState(0);
  const [selectedSlide, setSelectedSlide] = useState<any>(null);
  const [cart, setCart] = useState<any[]>([]);
  const [sessionTimer, setSessionTimer] = useState(1800);

  // Session timeout handler
  useEffect(() => {
    if (currentUser && sessionTimer > 0) {
      const timer = setTimeout(() => setSessionTimer(sessionTimer - 1), 1000);
      return () => clearTimeout(timer);
    } else if (sessionTimer === 0) {
      handleLogout();
    }
  }, [sessionTimer, currentUser]);

  const handleLogin = (userType: string) => {
    setCurrentUser(mockUsers[userType as keyof typeof mockUsers]);
    setCurrentPage('dashboard');
    setSessionTimer(1800);
  };

  const handleLogout = () => {
    setCurrentUser(null);
    setCurrentPage('login');
    setCart([]);
  };

  const simulateUpload = () => {
    setUploadProgress(0);
    const interval = setInterval(() => {
      setUploadProgress(prev => {
        if (prev >= 100) {
          clearInterval(interval);
          return 100;
        }
        return prev + 10;
      });
    }, 200);
  };

  const addToCart = (service: any) => {
    setCart(prev => [...prev, service]);
  };

  const removeFromCart = (serviceId: string) => {
    setCart(prev => prev.filter(item => item.id !== serviceId));
  };

  // Login Component
  const LoginComponent = () => (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 flex items-center justify-center">
      <div className="bg-white p-8 rounded-lg shadow-xl max-w-md w-full">
        <div className="text-center mb-8">
          <div className="mx-auto w-16 h-16 bg-blue-600 rounded-full flex items-center justify-center mb-4">
            <Shield className="w-8 h-8 text-white" />
          </div>
          <h1 className="text-2xl font-bold text-gray-800">PCI Digital Slides</h1>
          <p className="text-gray-600">HIPAA-Compliant Analysis Platform</p>
        </div>
        
        <div className="space-y-4">
          <h2 className="text-lg font-semibold text-center mb-4">Demo Login (Select User Type)</h2>
          
          <button 
            onClick={() => handleLogin('patient')} 
            className="w-full p-3 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
          >
            Patient Login
          </button>
          
          <button 
            onClick={() => handleLogin('business')} 
            className="w-full p-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
          >
            Business User Login
          </button>
          
          <button 
            onClick={() => handleLogin('pci')} 
            className="w-full p-3 bg-purple-600 text-white rounded-lg hover:bg-purple-700 transition-colors"
          >
            PCI User Login
          </button>
          
          <button 
            onClick={() => handleLogin('admin')} 
            className="w-full p-3 bg-red-600 text-white rounded-lg hover:bg-red-700 transition-colors"
          >
            PCI Admin Login
          </button>
        </div>
        
        <div className="mt-6 p-4 bg-blue-50 rounded-lg">
          <p className="text-sm text-blue-800">
            <Shield className="inline w-4 h-4 mr-1" />
            All data is encrypted and HIPAA compliant
          </p>
        </div>
      </div>
    </div>
  );

  // Header Component
  const Header = () => (
    <header className="bg-white shadow-sm border-b">
      <div className="flex items-center justify-between px-6 py-4">
        <div className="flex items-center space-x-4">
          <button onClick={() => setSidebarOpen(!sidebarOpen)} className="lg:hidden">
            <Menu className="w-6 h-6" />
          </button>
          <h1 className="text-xl font-bold text-gray-800">PCI Digital Slides</h1>
        </div>
        
        <div className="flex items-center space-x-4">
          <div className="text-sm text-gray-600">
            Session: {Math.floor(sessionTimer / 60)}:{(sessionTimer % 60).toString().padStart(2, '0')}
          </div>
          <Bell className="w-5 h-5 text-gray-600" />
          <div className="flex items-center space-x-2">
            <span className="text-sm font-medium">{currentUser?.name}</span>
            <span className="text-xs bg-blue-100 text-blue-800 px-2 py-1 rounded">{currentUser?.role}</span>
          </div>
          <button onClick={handleLogout} className="text-gray-600 hover:text-red-600">
            <LogOut className="w-5 h-5" />
          </button>
        </div>
      </div>
    </header>
  );

  // Sidebar Component
  const Sidebar = () => {
    const menuItems = [
      { key: 'dashboard', icon: BarChart3, label: 'Dashboard', roles: ['Patient', 'Business User', 'PCI User', 'PCI Admin'] },
      { key: 'upload', icon: Upload, label: 'Upload Slides', roles: ['Business User', 'PCI User', 'PCI Admin'] },
      { key: 'slides', icon: FileText, label: 'My Slides', roles: ['Patient', 'Business User', 'PCI User', 'PCI Admin'] },
      { key: 'catalog', icon: Package, label: 'Services', roles: ['Business User', 'PCI User', 'PCI Admin'] },
      { key: 'cart', icon: ShoppingCart, label: `Cart (${cart.length})`, roles: ['Business User', 'PCI User', 'PCI Admin'] },
      { key: 'admin', icon: Settings, label: 'Admin Panel', roles: ['PCI Admin'] }
    ];

    return (
      <aside className={`bg-gray-800 text-white w-64 min-h-screen ${sidebarOpen ? 'block' : 'hidden'} lg:block`}>
        <div className="p-4">
          <div className="flex items-center justify-between">
            <h2 className="text-lg font-semibold">Menu</h2>
            <button onClick={() => setSidebarOpen(false)} className="lg:hidden">
              <X className="w-5 h-5" />
            </button>
          </div>
        </div>
        
        <nav className="mt-4">
          {menuItems
            .filter(item => item.roles.includes(currentUser?.role))
            .map(item => (
              <button
                key={item.key}
                onClick={() => setCurrentPage(item.key)}
                className={`w-full flex items-center space-x-3 px-6 py-3 text-left hover:bg-gray-700 transition-colors ${
                  currentPage === item.key ? 'bg-gray-700 border-r-4 border-blue-500' : ''
                }`}
              >
                <item.icon className="w-5 h-5" />
                <span>{item.label}</span>
              </button>
            ))}
        </nav>
      </aside>
    );
  };

  // Dashboard Component
  const Dashboard = () => (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-6">Dashboard</h2>
      
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        <div className="bg-white p-6 rounded-lg shadow">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Total Slides</p>
              <p className="text-2xl font-bold">{mockSlides.length}</p>
            </div>
            <FileText className="w-8 h-8 text-blue-600" />
          </div>
        </div>
        
        <div className="bg-white p-6 rounded-lg shadow">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Processing</p>
              <p className="text-2xl font-bold">1</p>
            </div>
            <Clock className="w-8 h-8 text-yellow-600" />
          </div>
        </div>
        
        <div className="bg-white p-6 rounded-lg shadow">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Completed</p>
              <p className="text-2xl font-bold">1</p>
            </div>
            <CheckCircle className="w-8 h-8 text-green-600" />
          </div>
        </div>
        
        <div className="bg-white p-6 rounded-lg shadow">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600">Cart Items</p>
              <p className="text-2xl font-bold">{cart.length}</p>
            </div>
            <ShoppingCart className="w-8 h-8 text-purple-600" />
          </div>
        </div>
      </div>
      
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <div className="bg-white p-6 rounded-lg shadow">
          <h3 className="text-lg font-semibold mb-4">Recent Activity</h3>
          <div className="space-y-4">
            {mockSlides.map(slide => (
              <div key={slide.id} className="flex items-center justify-between border-b pb-2">
                <div>
                  <p className="font-medium">{slide.filename}</p>
                  <p className="text-sm text-gray-600">{slide.upload_date}</p>
                </div>
                <span className={`px-2 py-1 rounded-full text-xs ${
                  slide.status === 'processed' ? 'bg-green-100 text-green-800' :
                  slide.status === 'processing' ? 'bg-yellow-100 text-yellow-800' :
                  'bg-gray-100 text-gray-800'
                }`}>
                  {slide.status}
                </span>
              </div>
            ))}
          </div>
        </div>
        
        <div className="bg-white p-6 rounded-lg shadow">
          <h3 className="text-lg font-semibold mb-4">System Status</h3>
          <div className="space-y-4">
            <div className="flex items-center justify-between">
              <span>System Health</span>
              <div className="flex items-center space-x-2">
                <CheckCircle className="w-4 h-4 text-green-600" />
                <span className="text-green-600">Operational</span>
              </div>
            </div>
            <div className="flex items-center justify-between">
              <span>HIPAA Compliance</span>
              <div className="flex items-center space-x-2">
                <Shield className="w-4 h-4 text-green-600" />
                <span className="text-green-600">Active</span>
              </div>
            </div>
            <div className="flex items-center justify-between">
              <span>Data Encryption</span>
              <div className="flex items-center space-x-2">
                <Lock className="w-4 h-4 text-green-600" />
                <span className="text-green-600">Enabled</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

  // Upload Component
  const UploadComponent = () => (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-6">Upload Slides</h2>
      
      <div className="bg-white p-6 rounded-lg shadow mb-6">
        <h3 className="text-lg font-semibold mb-4">File Upload</h3>
        
        <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center">
          <Upload className="w-12 h-12 text-gray-400 mx-auto mb-4" />
          <p className="text-lg font-medium text-gray-700 mb-2">Drag and drop your slides here</p>
          <p className="text-sm text-gray-500 mb-4">Supported formats: .svs, .scn, .tiff</p>
          
          <div className="space-y-4">
            <button 
              onClick={simulateUpload}
              className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition-colors"
            >
              Select Files
            </button>
            
            {uploadProgress > 0 && (
              <div className="w-full bg-gray-200 rounded-full h-2">
                <div 
                  className="bg-blue-600 h-2 rounded-full transition-all duration-300" 
                  style={{ width: `${uploadProgress}%` }}
                ></div>
              </div>
            )}
          </div>
        </div>
        
        <div className="mt-6 p-4 bg-yellow-50 rounded-lg">
          <p className="text-sm text-yellow-800">
            <AlertTriangle className="inline w-4 h-4 mr-1" />
            Patient data will be automatically de-identified and encrypted during upload
          </p>
        </div>
      </div>
    </div>
  );

  // Main render function
  if (!currentUser) {
    return <LoginComponent />;
  }

  return (
    <div className="flex min-h-screen bg-gray-100">
      <Sidebar />
      
      <div className="flex-1 flex flex-col">
        <Header />
        
        <main className="flex-1 overflow-auto">
          {currentPage === 'dashboard' && <Dashboard />}
          {currentPage === 'upload' && <UploadComponent />}
        </main>
      </div>
    </div>
  );
};

export default HIPAASlideplatform;
